import React from "react";
import "./Hero.css";

function Hero() {
  return (
    <section className="hero-section">
      <div className="hero-background"></div>
      <div className="hero-overlay"></div>
      <div className="hero-content">
        <h1>Herion Music Theme</h1>
        <h2>Perfect for Bands, Labels, Festivals, Music Store & More</h2>
        <p>Build your music website with ease and style</p>
        <div className="hero-buttons">
          <button className="hero-btn primary-btn">View Demos</button>
          <button className="hero-btn secondary-btn">Purchase Now</button>
        </div>
      </div>
    </section>
  );
}

export default Hero;
